import "./TripStyles.css";
import TripData from "../components/TripData";
import Sell1 from "../assects/items/love u pendant.jpg";
import Sell2 from "../assects/items/My Tiny Heart Gold Earrings.jpg";
import Sell3 from "../assects/items/Diamond Dainty Ring.jpg";

function Trip(){
    return(
        <div className="trip">
            <h1>Recent Trips</h1>
            <p>The concat Javascript multiline comments, also known as block comments,
                 start with a forward slash followed by an asterisk method joins two 
                 or more strings. The concat method does not change the existing strings.
                  The concat method returns a new string.</p>
            <div className="tripcard">
                <TripData
                    image={Trip1}
                    heading= "Love U Pendant"
                    price= "LKR 67,918.00"
                />

                <TripData
                    image={Trip2}
                    heading= "My Tiny Heart Gold Earrings"
                    price= "LKR 51,023.00"
                />

                <TripData
                    image={Trip3}
                    heading= "Diamond Dainty Ring"
                    price= "LKR 87,560.00"
                />
                
            </div>
        </div>
    );
}

export default Trip;
